import __main__

def main(path):
    __main__.rep[1]='<br>'
    file_write=open(path,'w',encoding="utf-8")
    file_write.writelines('<!DOCTYPE html>\n<html>\n    <head>\n        <meta charset="utf-8" />\n		<link rel="icon" href="data:image/x-icon;base64," />\n        <title>'+__main__.rep[0]+'</title>\n    </head>\n    <body>\n')
    file_write.close()
    for i in range(len(__main__.rep)):
        file_write=open(path,'a',encoding="utf-8")
        file_write.writelines('        <p style="font-family: Arial; line-height: normal;">'+__main__.rep[i]+'</p>\n')
        file_write.close()
    file_write=open(path,'a',encoding="utf-8")
    file_write.writelines('    </body>\n</html>')
    file_write.close()
    __main__.rep[1]=''
